import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import Chat from "./pages/Chat";
import Booking from "./pages/Booking";
import LessonsTab from "./pages/LessonsTab";
import LessonViewer from "./pages/LessonViewer";
import AdminReservas from "./pages/AdminReservas";
import Lessons from "./pages/Lessons";
import Home from "./pages/Home";
import Navbar from "./components/Navbar";



export default function App() {
  return (
    <div className="min-h-screen bg-gray-100 text-gray-900 font-sans">
      <nav className="bg-blue-700 text-white p-4 flex gap-4 justify-center">

        <Link to="/">Inicio</Link>
        <Link to="/chat">Chat</Link>
        <Link to="/lecciones">Lecciones</Link>
        <Link to="/lecciones-avanzadas">Actividades</Link>
        <Link to="/reserva">Reservar</Link>

      </nav>

      <main className="p-6">
        <Routes>
          <Route path="/" element={<div className="text-center text-xl">Bienvenido a NEO_BLA_BLA</div>} />
          <Route path="/chat" element={<Chat />} />
          <Route path="/lecciones" element={<LessonViewer />} />
          <Route path="/lecciones-avanzadas" element={<LessonsTab />} />
          <Route path="/reserva" element={<Booking />} />
          <Route path="/admin-reservas" element={<AdminReservas />} />
          <Route path="/lecciones" element={<Lessons />} />
          <Route path="/" element={<Home />} />


        </Routes>
      </main>
    </div>
  );
}
